‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä
In 1963, Mechoulam and a team of researchers identified the chemical structure of Cannabidiol, or ‚ÄúCBD‚Äù (Mechoulam & Shvo, 1963). Then, in 1964 Mechoulam discovered the main psychoactive element of Cannabis Sativa plant, Delta-9-tetrahydrocannabinol or ‚ÄúTHC‚Äù (Gaoni & Mechoulam, 1964).‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä
‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä
It was later discovered that cannabinoids are also produced naturally in humans and animals.‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä
‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä
Humans and all the animals with a backbone have the endocannabinoid system.‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä
‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä
ECS is involved in a variety of physiological processes including neurogenesis, homeostatic regulation, energy balance, appetite, immune function, pain-sensation, mood, stress response, memory, and in mediating the psychoactive effects of cannabis (Pacher & Kunos, 2013).";}i:186;a:1:{s:14:"comments_count";i:1;}i:187;a:1:{s:11:"likes_count";i:4;}i:188;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEucYXtJCvU";}i:189;a:1:{s:5:"image";s:248:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/118717012_112838183883724_6508648255059340294_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=104&_nc_ohc=elDDpQKSUogAX8-O_UQ&_nc_tp=18&oh=6d32c2a578f7e6ac65df04aae6f03f13&oe=5F7C21EA";}i:190;a:1:{s:4:"type";s:5:"image";}i:191;a:1:{s:8:"owner_id";i:8180919563;}i:192;a:1:{s:14:"owner_username";s:0:"";}i:193;a:1:{s:14:"owner_fullname";s:0:"";}i:194;a:1:{s:9:"owner_pic";s:0:"";}i:195;a:1:{s:2:"id";s:19:"2390973241498905550";}i:196;a:1:{s:10:"short_code";s:11:"CEucX7HAavO";}i:197;a:1:{s:12:"created_time";i:1599246246;}i:198;a:1:{s:7:"caption";s:483:"We‚Äôll be getting into some adventures this long weekend chasing more moments like this. Where are you headed, and what are you doing with your day off?‚†Ä
